import React from 'react'

const Navigation = () => {
  return (
    <>
    <div className="full-nav">
      <div className="nav-cont">
      <Logo></Logo>
      <Textnav></Textnav>




     </div>
     <Sidenav></Sidenav>

    </div>

    </>
  )
}



let Logo =()=>{

  return(
    <div className="logo">
     <img src="images/rhino-logo.png" alt="" className="logo-image"/>
    </div>
  )
}
let Sidenav =()=>{

  return(
    <div  className="sidenavbar">
      <img src="images/account-ash.png" alt="" className="nav-image"/>
      <div className="redsapce"></div>
      <img src="images/shopping-bag-ash.png" alt="" className="nav-image"/>
      <div className="redsapce"></div>
      <img src="images/love-ash.png" alt="" className="nav-image"/>
      <div className="redsapce"></div>
    </div>
  )
}

let Textnav =()=>{


  return(
     <>
         <div className="textnav-ash">
           <h1 className="nav-btn">about</h1>
           <h1 className="nav-btn">categories</h1>
           <h1 className="nav-btn">explore</h1>
         </div>
     </>
  )
}

export default Navigation
